// Navbar.js
import React from 'react';
import './Navbar.css'; // Navbar stil dosyası

const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="navbar-left">
        <h1>CRM Support</h1>
      </div>
      <div className="navbar-right">
        <ul>
          <li><a href="#main">Ana Sayfa</a></li> {/* Ana sayfaya kaydır */}
          <li><a href="#about">Hakkımızda</a></li> {/* Hakkımızda kısmına kaydır */}
          <li><a href="#contact">İletişim</a></li> {/* İletişim kısmına kaydır */}
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
